import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Home from './Home';

class App extends Component {
  constructor() {
    super();
    this.state = {
      user: 'Sourabh'
    }
  }
  render() {
    return (
      <Home user={this.state.user}/>
    );
  }
}

export default App;
